import Inicio from "../componentes/Inicio";

export default class InicioPagina extends React.Component {

     render() {
                return(
                   <>
                   <h2 className="text-center">Página SPA de Fútbol</h2>

            <Inicio
            titulo="Premier League Inglésa" 
            img="./img/historia.jpeg"
            descripcion="El fútbol (o soccer, como se llama el juego en algunas partes del mundo) tiene una larga historia. El fútbol en su forma actual surgió en Inglaterra a mediados del siglo XIX. Pero ya existían versiones alternativas del juego mucho antes y forman parte de la historia del fútbol." 
            parrafo="aaa" />
            </>
    )
}
}
